import React from 'react'
import './Profile.css';
// import profilePic from '../../assets/images/download.jpeg';
import { Typography } from "@material-ui/core";
import  CustomTimeline  from "../Timeline/Timeline";
import resumeData from '../../utils/resumeData';
import PersonOutlineOutlinedIcon from '@mui/icons-material/PersonOutlineOutlined';
import { TimelineItem } from '@material-ui/lab';

const CustomTimelineItem = ({title, text, link}) => {
    <TimelineItem className={'timeline_firstItem'}>
    <TimelineSeparator>
      <TimelineDot className={"timeline_dot_header"}>{icon}</TimelineDot>
      <TimelineConnector />
    </TimelineSeparator>
    <TimelineContent>
      <Typography variant='h6' className={'timline_header'}>
        {title}
      </Typography>
      </TimelineContent>
  </TimelineItem>
}

const Profile = () => {
    return (
        <div className = "profile container_shadow ">
            <div className = "profile_name" >
                <Typography className="name">
                  {resumeData.name}
                </Typography>
                <Typography className="title">
                {resumeData.title}
                </Typography>
            </div>

            <figure className = "profile_image">
                <img src = {require("../../assets/images/download.jpeg")} alt="" />

            </figure>

            <div className = "profile_information">
              <CustomTimeline icon={<PersonOutlineOutlinedIcon/>}   > </CustomTimeline> 
                <br />
                <button>My button</button>
            </div>

        </div>
    );
};

export default Profile;
